def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return None
    parts = input1.split()
    result = []
    for part in parts:
        sub_parts = part.split('-')
        sub_result = sub_parts[0]
        for sub_part in sub_parts[1:]:
            sub_result += sub_part.capitalize()
        result.append(sub_result)
    return ' '.join(result)
